import React from 'react'
import Header from './components/Header'
import Welcome from './pages/Welcome'
import Partner from './pages/Partner';
import Footer from './components/Footer';
import Booking from './pages/Booking';
function App() {
  return (
    <div>
      <Header/>
      <Welcome/>
      <Partner/>
      <Booking/>
      <Footer/>
    </div>
  );
};

export default App;
